const JSEncrypt = require("JSEncrypt");

encodePassword = function (e) {
    var t = "";
    var o = new JSEncrypt;
    o.setPublicKey(t);
    return encodeURIComponent(o.encrypt(e))
}



ee = "qwe123"
console.log(encodePassword(ee))